import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import SearchField from './SearchField'

class App extends Component {
  render() {
    return (
      <div className="row">
        <div className="">
          <SearchField/>
        </div>
      </div>

    );
  }
}

export default App;


